<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./d-f1.css" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Roboto Slab:wght@700;800&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Roboto:wght@400&display=swap"
    />
  </head>
  <body>
    <div class="df1">
      <header class="frame-header">
        <div class="rectangle-parent13">
          <img
            class="frame-child22"
            alt=""
            src="./public/rectangle-188@2x.png"
          />

          <div class="rectangle-parent14">
            <img
              class="frame-child23"
              alt=""
              src="./public/rectangle-198@2x.png"
            />

            <img
              class="frame-child24"
              loading="lazy"
              alt=""
              src="./public/rectangle-208@2x.png"
            />
          </div>
        </div>
        <div class="navbar11">
          <img class="lh-icon10" alt="" src="./public/lh@2x.png" />

          <div class="back-button-container1">
            <img
              class="back-icon9"
              id="backIcon"
              loading="lazy"
              alt=""
              src="./public/back.svg"
            />
          </div>
        </div>
      </header>
      <section class="footer10">
        <div class="foto-ini-dibuat">
          Foto ini dibuat untuk projek materi Comma Design. Dalam foto ini saya
          belajar banyak dalam editing foto dari foto mentah menjadi foto studio
          hanya bermodalkan editing.
        </div>
      </section>
    </div>
    <script>
      var backIcon = document.getElementById("backIcon");
      if (backIcon) {
        backIcon.addEventListener("click", function (e) {
          window.history.back();
        });
      }
    </script>
  </body>
</html>
